import React from 'react';

const AddLivre = () => {
    return (
        <div>
            <p>Mandeh</p>
            <input type="text" placeholder='Entrer Title' />
            <input type="text" placeholder='Entrer description' />
        </div>
    );
};

export default AddLivre;
